import React, { Component } from 'react';
import { Button, Container, Row, Col, Dropdown, DropdownButton } from 'react-bootstrap';

class ListFilm extends Component {

    
    render(){

        return (
            <Container className='py-5'>
                <Row>
                    <Col md={10} className="d-inline-flex text-white">
                        <h1 className="pr-5">List Film</h1>
                        <DropdownButton
                        alignLeft
                        title="Category"
                        id="dropdown-menu-align-right"
                        variant="outline-light"
                        >
                            <Dropdown.Item eventKey="1">Action</Dropdown.Item>
                            <Dropdown.Item eventKey="2">Another action</Dropdown.Item>
                            <Dropdown.Item eventKey="3">Something else here</Dropdown.Item>
                            <Dropdown.Divider />
                            <Dropdown.Item eventKey="4">Separated link</Dropdown.Item>
                        </DropdownButton>
                    </Col>
                    <Col md={2} className='text-right'>
                        <Button className="btn btn-outline-danger text-white" style={{background: '#E50914'}} block>Add Film</Button>
                    </Col>
                </Row>
            </Container>
        );
    }
}

export default ListFilm;
